import React from 'react';
import {BrowserRouter as Router, Switch,Route} from 'react-router-dom';
import Welcome from '../layout/Welcome';
import AdminLogin from '../layout/AdminLogin';
import DoctorLogin from "../layout/DoctorLogin";
import VCLogin from '../layout/VCLogin';
import VerifierLogin from '../layout/VerifierLogin';
import AdminNavigation from '../components/AdminNavigation';
import  AdminProfile from '../layout/adminPanel/AdminProfile';
import  AdminDashboard from '../layout/adminPanel/AdminDashboard';
import  VCRegistration from '../layout/adminPanel/VCRegistration';
import  VerificationRegistration from '../layout/adminPanel/VerificationRegistration';



export default function ReactRouter(){
return(
<Router>
<Switch>
<Route exact path="/" component={Welcome} />
<Route exact path="/AdminLogin" component={AdminLogin} />
<Route exact path="/VCLogin" component={VCLogin} />
<Route exact path="/VerifierLogin" component={VerifierLogin} />
<Route exact path="/DoctorLogin" component={DoctorLogin} />
<Route exact path="/AdminNavigation" component={AdminNavigation} />
</Switch>
</Router>
);
}
